import logo from './logo.svg';
import './App.css';
import * as MUI from '@mui/material';

function App() {
  return (
    <div className="App">
        <MUI.Stack sx={{ width: '50%' }} spacing={2}>
            <MUI.Alert severity="error">
                <MUI.AlertTitle>Error</MUI.AlertTitle>
                This is an error MUI.Alert � <strong>check it out!</strong>
            </MUI.Alert>
            <MUI.Alert severity="warning">
                <MUI.AlertTitle>Warning</MUI.AlertTitle>
                This is a warning MUI.Alert � <strong>check it out!</strong>
            </MUI.Alert>
            <MUI.Alert severity="info">
                <MUI.AlertTitle>Info</MUI.AlertTitle>
                This is an info MUI.Alert � <strong>check it out!</strong>
            </MUI.Alert>
            <MUI.Alert severity="success">
                <MUI.AlertTitle>Success</MUI.AlertTitle>
                This is a success MUI.Alert � <strong>check it out!</strong>
            </MUI.Alert>
        </MUI.Stack>
    </div>
  );
}

export default App;
